import { useState } from "react";
import { Navigate, useLocation } from "react-router";
import { callUrl } from '../services/callApi';
import { useNavigate } from "react-router";
import './Profile.css'

const Profile = () => {
    const [urls, setUrls] = useState([]);
    const [errorMessage, setErrorMessage] = useState("");
    const navigate = useNavigate()
    const location = useLocation()

    const name= location.state.
    console.log("jjjj",location)

    const findproject=()=>{
        callUrl(urls)
        .then(res => {
            // setUrls(res.data.url);
           })
        .catch(()=>
            setErrorMessage("Unable to fetch urls"))
    }

    const backButton = ()=>{
        navigate(-1)
    }

    return (
        <div>

            <button className='backToSearch' onClick={backButton}>Back to Search</button>
            <div  className="profilecard">

                    <div className="profilebodycard">

                        <img alt="profile"src={"item.avatar_url"}></img>
                        <div className="profilename">{"item.login"}</div>

                    </div>

                </div> 
                <div className='cardbutton'>
                    <button className='Followers'>Followers:{"user.fallowers"}</button>
                    <button className='Folloing'>Folloing:{"user.folloing"}</button>
                    <button className='publicrespons'>Public Repos:{"user.publicrespons"}</button>
                    <button className='publicgits'>Public Gists:{"user.publicgits"}</button>
                </div>
                <div>
                { urls.map((user,index)=>{
                        return(
                            <div  className="project">
                              <div className="login"key={user.id}>
                                  <a onClick={findproject}>{user.url}</a></div>
                            </div>) 
                    })}
                </div>
        </div>
    );
};

export default Profile;
